import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { GET_ALL_STORE_SAGA } from '../redux/type/StoreType'

export default function Nav() {

    const dispatch = useDispatch()
    const { listStore } = useSelector(state => state.storeReducer)

    useEffect(() => {
        dispatch({
            type: GET_ALL_STORE_SAGA
        })
    }, [])

    const renderLink = () => {
        return listStore.map((item, index) => {
            return <a className="nav-link" aria-current="page" href="gdsgsd">Store {index}</a>
        })
    }
    return (
        <div>
            <nav className="nav flex-column" style={{ width: '100%%', backgroundColor: '#163975', minHeight: '713px' }}>
                <p style={{ color: 'white', fontSize: '25px' }}>MILK TEA STORE</p>
                {renderLink()}
            </nav>
        </div>
    )
}
